function SVG_reader(_S){

var S = _S != undefined ? _S : new OO.SceneManager();


/*typical INPUT : */
/*

<svg baseProfile="full" height="1351" version="1.1" viewBox="0 0 2323 1351" width="2323" xmlns="

<g class="psd-layer group" opacity="0.25098039215686274" style="mix-blend-mode: normal;">
    <title>CADRES</title>
    <image class="psd-layer shape" height="1024" width="1810" x="1246" xlink:href="data:image/png;base64," y="834">
      <title>ep202_pl020</title>
    </image>
    <image class="psd-layer shape" height="2427" width="6076" x="-7" xlink:href="data:image/png;base64," y="-7">
      <title>bg_size</title>
    </image>
    <image class="psd-layer shape" height="752" width="1327" x="2502" xlink:href="data:image/png;base64," y="1140">
      <title>ep201_pl010</title>
    </image>
  </g>
	*/
	
	
	this.get_cadre = function(XMLobj,shot_code){
		
		var repport ="";
		
		var cadre = {};
		
		var match = 0;
		
		//the ful width and height of the psd : 
		
		var attr = XMLobj._Attribs
		
		if(attr.hasOwnProperty('height')==true){
			
			match++;
			
			var rect = {
				
				width:attr.width,
				height:attr.height
				
			}			
			
			cadre.bg = rect;
			
		}
		
		S.log.add("[SVG] Dimentions du psd","process");
		S.log.add("[SVG] bg width = "+cadre.bg.width,"process");
		S.log.add("[SVG] bg height = "+cadre.bg.height,"process");
		
		var groups = XMLobj['g'];
		
		//MessageLog.trace("SEARCHING FOR "+shot_code);	
			
			for(var i in groups){
				
				cg = groups[i]; 
				
				var group_title = cg.title;
					
				// possible problems if thee is just one group
				
				if(group_title=="CADRES"){
					
					S.log.add("[SVG] found group : "+group_title,"process");
					
					var gimages = cg['image']; 
					
					for(var i in gimages){
						
						var cimage = gimages[i]; 
						//S.log.add("cadre "+cimage.title,"process");
						
						var image_title = "";
						
						var image_attributes = ""
						
						if(i == "title"){
								
							image_title = gimages[i];
							image_attributes = gimages._Attribs;
								
						}else{
							
							image_title = cimage.title;
							image_attributes = cimage._Attribs;
				
						}
						
						if(image_title == shot_code){
							
							S.log.add("[SVG] found layer ( "+image_title+" ) for shot  ( "+shot_code+" )","process");
	
							var attr = image_attributes;
							
							var rect = {
								width:attr.width,
								height:attr.height,
								x:attr.x,
								y:attr.y
							}
								
								
							S.log.add("[SVG] cadre ( "+image_title+" )","process");
							S.log.add("[SVG] width ( "+attr.width+" )","process");
							S.log.add("[SVG] height ( "+attr.height+" )","process");
							S.log.add("[SVG] x ( "+attr.x+" )","process");
							S.log.add("[SVG] y ( "+attr.y+" )","process");

								
							cadre.rect = rect;
							
							match++;
							
						}else{
							
							
							
						}
						
						// !! would actulay need to get this from the svg infos. not from a layer
						
						if(cimage.title == "bg_size"){
							
							var attr = cimage._Attribs;
							
							var rect = {
								width:attr.width,
								height:attr.height,
							}
								
							//MessageLog.trace(attr);	
								
							cadre.bg = rect;
						}
							
					}				
					
				}

			}
			
		if(match > 0){
			
			return cadre ;
			
		}else{
			
			//MessageLog.trace("NO CADRE FOUND")
			
			return false ;
			
		}
			
		
	}
	
}